import React from "react";


export const Sasi=()=>{
    return(
    <ul>
        <li>manoj</li>
        <li>kumar</li>
    </ul>
    )
}
//new components
export const Mani=()=>{
    return(
        <table>
        <tr>
          <th>Company</th>
          <th>Contact</th>
          <th>Country</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>
        <tr>
          <td>Centro comercial Moctezuma</td>
          <td>Francisco Chang</td>
          <td>Mexico</td>
        </tr>
      </table>
    )
}

export const Component2=()=>{
    return(
        <>
        <h2>An ordered HTML list</h2>

        <ol>
          <li>Coffee</li>
          <li>Tea</li>
          <li>Milk</li>
        </ol>
        </>
    )
}
